import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";
import './index.css';
import Reid from "./images/reid.png";
import ReTweet from "./images/retweet-action.png"
import Like from "./images/like-action.png"

class Random extends Component {
    render() {
        return (
            <Container className="container-random">
                <Row>
                    <Col className=" col-2">
                    <h6 className="d-inline favorite-name ml-1 mt-1"><strong>Reid Muchow</strong></h6>
                    </Col>
                    <Col className="col-3">
                    <h6 className="d-inline favorite-name ml-1 mt-1"><strong>Reid Muchow</strong></h6>
                    </Col>
                    <Col className="col-4">
                    </Col>
                    <Col className="col-5">
                    </Col>
                </Row>
            </Container>
        )
    }
}

export default Random;
